import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ul>
          <li>リンク</li>
          <li>リンク</li>
          <li>リンク</li>
        </ul>
      </header>

      <div className="top">
        <div className="top-contents">
          <div className="title-text">タイトルテキスト</div>
          <div className="button button-blue">ボタンテキストが入ります</div>
        </div>
      </div>
    </div>
  );
}

export default App;
